function importarArchivo() {
    if (document.getElementById('fileTest').files.length > 0) {
        let input = document.getElementById('fileTest');
        let files = input.files;
        let formData = {
            "files": [],
        }

        for (let i = 0; i != files.length; i++) {
            formData.files[i] = { 'file': files[i] };
        }

        const wb = new ExcelJS.Workbook();

        const FILE_DATA = formData.files[0].file;
        const FILE_NAME = FILE_DATA.name;

        wb.clearThemes()

        wb.xlsx.load(FILE_DATA).then(() => {

            //Get workfile sheet
            let sheet = wb.worksheets[0]
            let plansFound = [];
            let excelKeys = [];
            sheet.eachRow({ includeEmpty: false }, function (row, rowNumber) {

                if (rowNumber === 5) {
                    excelKeys = row.values;
                }

                if (rowNumber > 5) {
                    plansFound.push(row.values);
                }

            });

            if (excelKeys[0] === undefined) {
                excelKeys.splice(0, 1);
            }

            //console.log(excelKeys);

            plansFound.forEach(arr => {
                if (arr[0] === undefined) {
                    arr.splice(0, 1);
                }
            })

            let objectsGenerated = [];
            let errorObjects = [];

            console.log(plansFound)


            $.each(plansFound, function (index, arr) {
                let objectCrafted = {
                    "Vehiculo": arr[0],
                    "operador": arr[1], //operador
                    "TipoMineral": arr[2],
                    "FechaAcarreo": arr[3],
                    "ToneladasTotales": arr[4],
                    "SitioCarga": arr[5],
                    "SitioDescarga": arr[6],


                };
                objectsGenerated.push(objectCrafted);
            })

            console.log(objectsGenerated)
            grid.option("dataSource", objectsGenerated)

        }).catch(err => {
            console.log(err.message);
        });

    }
}

document.getElementById("boton").addEventListener("click", function (e) {
    importarArchivo()
})

//global vars to identify exporting promise status
//globalExportPromise: it contains a prmomise when a devextreme export fn is initialized
var globalExportPromise

//globalExportPromiseResolve: pointer to the resolve() function of the globalExportPromise promise (ouside the promise scope)
//it is called when the exportToExcel workbook.xlsx.writeBuffer() prmise is resolved
var globalExportPromiseResolve

//globalExportPromiseResolved: flag to check the current promise status outside the promise scope, its used to prevent the
//initialization of more than one globalExportPromise when the current one is not resolved yet
var globalExportPromiseResolved = true
function exportToExcel(e, fileName, mainTitle, secondaryTitle, dataDate, columnsNumberThatNeedToWrapText) {

    //current millisec to create a unic dynamic loader

    let milliSec = new Date().getTime()
    //showDynamicLoader("export_" + milliSec)

    return new Promise(async function (resolve, reject) {
        console.log("---creating")
        //Cancel default file download
        e.cancel = true

        //Create empty workbook
        const workbook = new ExcelJS.Workbook()

        //Load table data
        await workbook.xlsx.load(e.data)

        //Clear loaded data themes to prevent excel exception
        workbook.clearThemes()

        //Get workfile sheet
        let sheet = workbook.worksheets[0]

        //Remove columns with titles that are in columnsToRemove

        let topHeaderLenght = sheet.columns.length

        //Clear loaded conditional formating to prevent excel exception
        sheet.removeConditionalFormatting()

        //Sheet page name
        sheet.name = 'Page 1'

        //Principal file cell styles
        sheet.eachRow({ includeEmpty: true }, function (row, rowNumber) {
            row.eachCell(function (cell, colNumber) {
                //All cells style
                cell.font = { name: 'Calibri', family: 2, bold: false, size: 9 }
                cell.alignment = { vertical: 'middle' }
                //First row style
                if (rowNumber == 1) {
                    cell.fill = { type: 'pattern', pattern: 'solid', fgColor: { argb: 'aae6e6ff' } }
                    cell.font = { name: 'Calibri', family: 2, bold: true, size: 9 }
                    cell.alignment = { horizontal: 'center' }
                    cell.showRowColHeaders = false
                    cell.border = { top: { style: 'thin' }, left: { style: 'thin' }, bottom: { style: 'thin' }, right: { style: 'thin' } }
                }
            })
        })


        sheet.getColumn(1).width = 20
        sheet.getColumn(5).width = 25
        //Unshift 4 spaces down to create fixed header
        sheet.insertRow(1, getEmptyArray(topHeaderLenght))
        sheet.insertRow(1, getEmptyArray(topHeaderLenght))
        sheet.insertRow(1, getEmptyArray(topHeaderLenght))
        sheet.insertRow(1, getEmptyArray(topHeaderLenght))

        //Freeze main header rows
        sheet.views = [{ state: 'frozen', ySplit: 5 }]

        //Rows to print on different pages
        sheet.pageSetup.printTitlesRow = '5:5'

        //Format top header style
        sheet.eachRow({ includeEmpty: true }, function (row, rowNumber) {
            row.eachCell(function (cell, colNumber) {
                if (rowNumber <= 4) {
                    cell.fill = { type: 'pattern', pattern: 'solid', fgColor: { argb: 'ff0B2A4A' } }
                    cell.font = { name: 'Calibri', family: 2, bold: true, size: 9, color: { argb: 'ffffffff' } }
                }
            })
        })

        sheet.getCell('B1').font = { name: 'Calibri', family: 2, bold: true, size: 12, color: { argb: 'ffffffff' } }
        sheet.getCell('B1').alignment = { horizontal: 'center' }
        sheet.getCell('B2').alignment = { horizontal: 'center' }
        sheet.getCell('B3').alignment = { horizontal: 'center' }

        //Merge center header cells
        sheet.mergeCells('B1:D1')
        sheet.mergeCells('B2:D2')
        sheet.mergeCells('B3:D3')
        sheet.mergeCells('A4:B4')

        //Set file info on header
        sheet.getCell('B1').value = mainTitle
        sheet.getCell('B2').value = secondaryTitle
        sheet.getCell('B3').value = dataDate

        //Fix columns sizes
        sheet.columns.forEach(col => {
            col.width = 20
        })

        //Fix rows outlineLevel
        for (let i = sheet._rows.length - 1; i > -1; i--) {
            if (i - 4 > -1) sheet._rows[i].outlineLevel = sheet._rows[i - 4].outlineLevel
            else sheet._rows[i].outlineLevel = 0
        }

        //File creation date
        let tempToday = new Date()

        let textDate = `${tempToday.getFullYear()}-${tempToday.getMonth() + 1}-${tempToday.getDate()}`
        let textHour = `${tempToday.getHours()} - ${tempToday.getMinutes()} - ${tempToday.getDate()}`//`${getTwoDigitsNumber(tempToday.getHours())}:${getTwoDigitsNumber(tempToday.getMinutes())}:${getTwoDigitsNumber(tempToday.getSeconds())} `
        sheet.getCell('A4').value = `fecha ${textDate} ${textHour} `

        //Cells dates regex to date value
        sheet.eachRow({ includeEmpty: true }, function (row, rowNumber) {
            row.eachCell(function (cell, colNumber) {
                if (rowNumber > 4) {
                    if (cell.value != null && typeof cell.value == 'string' && (cell.value.length == 19 || cell.value.length == 20) && (cell.value.match(/\d\d\d\d-\d\d-\d\d\s\s\d\d:\d\d:\d\d/) || cell.value.match(/\d\d\d\d-\d\d-\d\d\s\d\d:\d\d:\d\d/))) {
                        //console.log(cell.value)
                        //cell.value = new Date(cell.value)

                        let date = new Date(cell.value)
                        cell.value = new Date(Date.UTC(date.getFullYear(), date.getMonth(), date.getDate(), date.getHours(), date.getMinutes(), date.getSeconds()))

                        cell.numFmt = 'yyyy-mm-dd\\ hh:mm:ss\\'
                    } else {
                        if (!(cell.value instanceof Date && isFinite(cell.value.getTime()))) { // to prevent dates changing to numbers when we change the cell format
                            cell.numFmt = '@';
                        }
                    }
                }
            })
        })

        if (columnsNumberThatNeedToWrapText) {
            columnsNumberThatNeedToWrapText.forEach(columnNumber => {
                sheet.getColumn(columnNumber).alignment = { ...sheet.getColumn(columnNumber), wrapText: true }
                console.log('EXPORTING WRAP TEXT: ', columnNumber, ' props: ', sheet.getColumn(columnNumber).alignment);
            })
        }

        //Fetch and set smarflow image
        let sfImg = 'data:image/png;base64,'
        /*await fetchFileTo64("/images/smartflow_two_color.png")*/
        sfImg = workbook.addImage({ base64: sfImg, extension: 'png', })

        sheet.addImage(sfImg, 'A1:A2')

        //Fetch and set becker image
        let bkImg = 'data:image/png;base64,'
        //await fetchFileTo64("/images/smartflow_becker.png")
        bkImg = workbook.addImage({ base64: bkImg, extension: 'png', })
        sheet.addImage(bkImg, 'E1:E2')

        //Fetch and set lasec image
        let lasecImg = 'data:image/png;base64,'
        //await fetchFileTo64("/images/smartflow_lasec.png")
        lasecImg = workbook.addImage({ base64: lasecImg, extension: 'png', })
        sheet.getRow(4).height = 20
        sheet.addImage(lasecImg, 'E4:E4')
        console.log("---writing")

        //Export file as name 'x'
        workbook.xlsx.writeBuffer().then(async function (data) {
            console.log("---exporting")

            var blob = new Blob([data], { type: 'application/vnd.openxmlformats-officedocument.spreadsheetml.sheet' })

            //await timeOut(500)
            saveAs(blob, `${fileName} _ _ _ ${textDate} ${textHour}.xlsx`)
            //await timeOut(500)

            if (typeof globalExportPromiseResolve != 'undefined') globalExportPromiseResolve()
            //disableDynamicLoader("export_" + milliSec)
            resolve('exportToExcel resolved')

        })

        //Functions def
        //Get empty array of specified lenght to complete deepblue background in the header
        function getEmptyArray(lenght) {
            lenght < 5 ? lenght = 5 : lenght = lenght
            let array = []
            for (let i = 1; i <= lenght; i++) array.push('')
            return array
        }

        //Fetch img from local path and return data as 64
        async function fetchFileTo64(path) {
            return new Promise(async (resolve, reject) => {

                //Fetch file as blob
                let blob = await fetch(path).then(function (response) { return response.blob() })

                var reader = new FileReader()

                //Return blob as base64Data in resolve
                reader.onloadend = function () {
                    let base64data = reader.result
                    let file64 = workbook.addImage({ base64: base64data, extension: 'png', })
                    resolve(file64)
                }
                reader.readAsDataURL(blob)

            })
        }
    })
}